import React from "react";
import Task from "../components/Task";

export default {
  component : Task,
  title : 'task',
}

const Template = (args) => <Task {...args} />;

export const Default = Template.bind({});
Default.args = {
  task : {
    id : '1',
    title : 'Test Task',
    state : 'TASK_INBOX'
  }
}
